import React from 'react'
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Bangalore from '../components/Bangalore';
import PropertyRateinDelhi from '../components/PropertyRateinDelhi';

const PriceTrendinDelhi = () => {
    return (
      <>
      <Navbar/>
      <Bangalore/>
      <PropertyRateinDelhi/>
      <Footer/>
      </>
    )
  }
  
export default PriceTrendinDelhi
